      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={["['^(?P<timestamp>[\\w\\-:\\+]+) (?P<level>\\w+) (?P<message>.*)$']"]} groups={[]} name={"patterns"} path={null} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
