      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"types"} path={null} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "types"
        }}>{`types`}</h3>
        <p>{`Key/value pairs representing mapped log field names and types. This is used to
coerce log fields into their proper types.
See `}<a parentName="p" {...{
            "href": "#regex-syntax"
          }}>{`Regex Syntax`}</a>{` for more info.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={{
            "bool": "Coerces `\"true\"`/`/\"false\"`, `\"1\"`/`\"0\"`, and `\"t\"`/`\"f\"` values into boolean.",
            "float": "Coerce to a 64 bit float.",
            "int": "Coerce to a 64 bit integer.",
            "string": "Coerce to a string.",
            "timestamp": "Coerces to a Vector timestamp. [`strptime` specificiers][urls.strptime_specifiers] must be used to parse the string."
          }} examples={[{
            "status": "int"
          }, {
            "duration": "float"
          }, {
            "success": "bool"
          }, {
            "timestamp": "timestamp|%F"
          }, {
            "timestamp": "timestamp|%a %b %e %T %Y"
          }, {
            "parent": {
              "child": "int"
