            <h4 {...{
              "id": "field-name"
            }}><inlineCode parentName="h4">{`[field-name]`}</inlineCode></h4>
            <p>{`A definition of log field type conversions. They key is the log field name and
the value is the type. `}<a parentName="p" {...{
                "href": "https://docs.rs/chrono/0.4.11/chrono/format/strftime/index.html#specifiers"
              }}><inlineCode parentName="a">{`strptime`}</inlineCode>{` specifiers`}</a>{` are
supported for the `}<inlineCode parentName="p">{`timestamp`}</inlineCode>{` type.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>
    <p>{`Given the following log line:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-json",
        "metastring": "title=\"log event\"",
        "title": "\"log",
        "event\"": true
      }}>{`{
  "message": "5.86.210.12 - zieme4647 5667 [19/06/2019:17:20:49 -0400] \\"GET /embrace/supply-chains/dynamic/vertical\\" 201 20574"
}
`}</code></pre>
    <p>{`And the following configuration:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.<transform-id>]
  type = "regex_parser"
  field = "message"
  patterns = ['^(?P<host>[\\w\\.]+) - (?P<user>[\\w]+) (?P<bytes_in>[\\d]+) \\[(?P<timestamp>.*)\\] "(?P<method>[\\w]+) (?P<path>.*)" (?P<status>[\\d]+) (?P<bytes_out>[\\d]+)$']

[transforms.<transform-id>.types]
  bytes_in = "int"
  timestamp = "timestamp|%d/%m/%Y:%H:%M:%S %z"
  status = "int"
  bytes_out = "int"
`}</code></pre>
    <p>{`A `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode>{` event`}</a>{` will be output with the following structure:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-javascript",
        "metastring": "title=\"log event\"",
        "title": "\"log",
        "event\"": true
      }}>{`{
  // ... existing fields
  "bytes_in": 5667,
  "host": "5.86.210.12",
  "user_id": "zieme4647",
  "timestamp": <19/06/2019:17:20:49 -0400>,
  "message": "GET /embrace/supply-chains/dynamic/vertical",
  "status": 201,
  "bytes_out": 20574
}
`}</code></pre>
    <p>{`Things to note about the output:`}</p>
    <ol>
      <li parentName="ol">{`The `}<inlineCode parentName="li">{`message`}</inlineCode>{` field was overwritten.`}</li>
      <li parentName="ol">{`The `}<inlineCode parentName="li">{`bytes_in`}</inlineCode>{`, `}<inlineCode parentName="li">{`timestamp`}</inlineCode>{`, `}<inlineCode parentName="li">{`status`}</inlineCode>{`, and `}<inlineCode parentName="li">{`bytes_out`}</inlineCode>{` fields were coerced.`}</li>
    </ol>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`regex_parser`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "failed-parsing"
    }}>{`Failed Parsing`}</h3>
    <p>{`If the `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` value fails to parse against the provided `}<inlineCode parentName="p">{`regex`}</inlineCode>{` then an error
will be `}<a parentName="p" {...{
        "href": "/docs/administration/monitoring/#logs"
      }}>{`logged`}</a>{` and the event will be kept or discarded
depending on the `}<inlineCode parentName="p">{`drop_failed`}</inlineCode>{` value.`}</p>
    <p>{`A failure includes any event that does not successfully parse against the
provided `}<inlineCode parentName="p">{`regex`}</inlineCode>{`. This includes bad values as well as events missing the
specified `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{`.`}</p>
    <h3 {...{
      "id": "field-notation-syntax"
    }}>{`Field Notation Syntax`}</h3>
    <p>{`The `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` and `}<a parentName="p" {...{
        "href": "#target_field"
      }}><inlineCode parentName="a">{`target_field`}</inlineCode></a>{` options
support `}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`Vector's field notation syntax`}</a>{`,
enabling access to root-level, nested, and array field values. For example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.my_regex_parser_transform_id]
  # ...
  field = "message"
  field = "parent.child"
  # ...
`}</code></pre>
    <p>{`You can learn more about Vector's field notation in the
`}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`field notation reference`}</a>{`.`}</p>
    <h3 {...{
      "id": "performance"
    }}>{`Performance`}</h3>
    <p>{`The `}<inlineCode parentName="p">{`regex_parser`}</inlineCode>{` source has been involved in the following performance tests:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/timberio/vector-test-harness/tree/master/cases/regex_parsing_performance"
        }}><inlineCode parentName="a">{`regex_parsing_performance`}</inlineCode></a></li>
    </ul>
    <p>{`Learn more in the `}<a parentName="p" {...{
        "href": "/#performance"
      }}>{`Performance`}</a>{` sections.`}</p>
    <h3 {...{
      "id": "regex-debugger"
    }}>{`Regex Debugger`}</h3>
    <p>{`To test the validity of the`}<a parentName="p" {...{
        "href": "#regex"
      }}><inlineCode parentName="a">{`regex`}</inlineCode></a>{` option, we recommend the `}<a parentName="p" {...{
        "href": "https://rustexp.lpil.uk/"
      }}>{`Rust
Regex Tester`}</a>{`. Note, you `}<em parentName="p">{`must`}</em>{` use
`}<a parentName="p" {...{
        "href": "#named-captures"
      }}>{`named captures`}</a>{` in your regex to map the results to fields.`}</p>
    <h3 {...{
      "id": "regex-syntax"
    }}>{`Regex Syntax`}</h3>
    <p>{`Vector follows the `}<a parentName="p" {...{
        "href": "https://docs.rs/regex/1.3.6/regex/#syntax"
      }}>{`documented Rust Regex syntax`}</a>{` since
Vector is written in Rust. This syntax follows a Perl-style regular expression
syntax, but lacks a few features like look around and backreferences.`}</p>
    <h4 {...{
      "id": "named-captures"
    }}>{`Named Captures`}</h4>
    <p>{`You can name Regex captures with the `}<inlineCode parentName="p">{`<name>`}</inlineCode>{` syntax. For example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`^(?P<timestamp>\\w*) (?P<level>\\w*) (?P<message>.*)$
`}</code></pre>
    <p>{`Will capture `}<inlineCode parentName="p">{`timestamp`}</inlineCode>{`, `}<inlineCode parentName="p">{`level`}</inlineCode>{`, and `}<inlineCode parentName="p">{`message`}</inlineCode>{`. All values are extracted as
`}<inlineCode parentName="p">{`string`}</inlineCode>{` values and must be coerced with the `}<a parentName="p" {...{
        "href": "#types"
      }}><inlineCode parentName="a">{`types`}</inlineCode></a>{` table.`}</p>
    <p>{`More info can be found in the `}<a parentName="p" {...{
        "href": "https://docs.rs/regex/1.3.6/regex/#grouping-and-flags"
      }}>{`Regex grouping and flags
documentation`}</a>{`.`}</p>
    <h4 {...{
      "id": "flags"
    }}>{`Flags`}</h4>
    <p>{`Regex flags can be toggled with the `}<inlineCode parentName="p">{`(?flags)`}</inlineCode>{` syntax. The available flags are:`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Flag`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Descriuption`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`i`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`case-insensitive: letters match both upper and lower case`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`m`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`multi-line mode: ^ and $ match begin/end of line`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`s`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`allow . to match `}<inlineCode parentName="td">{`\\n`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`U`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`swap the meaning of `}<inlineCode parentName="td">{`x*`}</inlineCode>{` and `}<inlineCode parentName="td">{`x*?`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`u`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Unicode support (enabled by default)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`x`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`ignore whitespace and allow line comments (starting with `}<inlineCode parentName="td">{`#`}</inlineCode>{`)`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`For example, to enable the case-insensitive flag you can write:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`(?i)Hello world
`}</code></pre>
    <p>{`More info can be found in the `}<a parentName="p" {...{
        "href": "https://docs.rs/regex/1.3.6/regex/#grouping-and-flags"
      }}>{`Regex grouping and flags
documentation`}</a>{`.`}</p>
    <h3 {...{
      "id": "value-coercion"
    }}>{`Value Coercion`}</h3>
    <p>{`Values can be coerced upon extraction via the `}<a parentName="p" {...{
        "href": "#types"
      }}><inlineCode parentName="a">{`types.*`}</inlineCode></a>{` options. This functions
exactly like the `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/coercer/"
      }}><inlineCode parentName="a">{`coercer`}</inlineCode>{` transform`}</a>{` except that its
coupled within this transform for convenience.`}</p>
    <h4 {...{
      "id": "timestamps"
    }}>{`Timestamps`}</h4>
    <p>{`You can coerce values into timestamps via the `}<inlineCode parentName="p">{`timestamp`}</inlineCode>{` type:`}</p>
